You are a dragon. You can stick up for yourself,<br>and you could stick up for others, but chances<br>are you don't want to. You are stubborn, and<br>you belive in doing what you think is right,<br>not what others think is right. You're either a<br>very bad person, or a very good person, there<br>is no such thing as "somehwere in<br>between" or "sometimes good,<br>sometimes bad". You don't have any<br>sympathy for those who destroy their own lives.<br>Often you can seen gruff and uncaring, but no<br>one knows who you really are.
Your secret desire: To have control over<br>uncontrollable things. {Rate this quiz please!}
